import { Header } from './Header';
import { Grid, Paper, Stack } from '@mui/material';
import { ButtonClick } from './ButtonClick';
import { TextInput } from './TextInput';
import setBodyColor from './setBody';
import makeStyles from '@mui/styles/makeStyles/makeStyles';
import { useNavigate } from 'react-router-dom';
import { AuthRequest } from './models';
import { ChangeEvent, useState } from 'react';
import { authRequestLogin } from './AuthRequest';

export const SignIn = () => {
  const classes = useStyles();
  const navigate = useNavigate();

  const initialValue = {
    email: '',
    password: ''
  };

  const [auth, setAuth] = useState<AuthRequest>(initialValue);

  const redirectSignUpPage = (e) => {
    e.preventDefault();
    navigate('/signup');
  };

  const handleEmail = (event: ChangeEvent<HTMLInputElement>) => {
    event.preventDefault();
    setAuth({ ...auth, email: event.target.value });
  };

  const handlePassword = (event: ChangeEvent<HTMLInputElement>) => {
    setAuth({ ...auth, password: event.target.value });
  };

  const redirectHomePage = () => {
    navigate('/');
  };

  const onSubmit = (e) => {
    e.preventDefault();
    authRequestLogin(auth, redirectHomePage);
  };

  setBodyColor({ color: '#DDFFF7' });
  return (
    <div>
      <Header />
      <Paper elevation={2} className={classes.form}>
        <h1 className={classes.title}>Login</h1>
        <Stack spacing={2} direction="row" className={classes.formContainer}>
          <Grid container direction="column" gap={2}>
            <TextInput
              label="Email"
              type="email"
              fullwidth={true}
              onChange={handleEmail}
            />
            <TextInput
              label="Password"
              type="password"
              fullwidth={true}
              onChange={handlePassword}
            />
          </Grid>
        </Stack>
        <Stack
          className={classes.submitButtonStack}
          spacing={2}
          gap={2}
          direction="column"
          justifyContent="center"
        >
          <ButtonClick
            type="submit"
            variant="contained"
            backgroundColor="#FFA69E"
            size="large"
            onClick={(e) => onSubmit(e)}
          >
            Sumbit
          </ButtonClick>
          <Stack spacing={2} direction="column" gap={2}>
            Or sign up using
            <ButtonClick
              variant="contained"
              backgroundColor="#DDFFF7"
              color="black"
              onClick={(e) => redirectSignUpPage(e)}
            >
              Sign up
            </ButtonClick>
          </Stack>
        </Stack>
      </Paper>
    </div>
  );
};

const useStyles = makeStyles({
  title: {
    display: 'flex',
    justifyContent: 'center'
  },
  form: {
    width: '600px',
    margin: 'auto',
    marginTop: '150px',
    padding: '60px'
  },
  formContainer: {
    display: 'flex',
    justifyContent: 'center',
    alignItems: 'center'
  },
  submitButtonStack: {
    marginTop: '12px'
  }
});
